interface FormProps {
  onSubmit: (formData: FormData) => void;
}

export default function Form({ onSubmit }: FormProps) {
  const [todo, setTodo] = useState("");
  return (
    <form action={onSubmit}>
      <input type="text" name="todo" value={todo} />
      <button type="submit">submit</button>
    </form>
  );
}
